        uint256 tokensForLP = tAmount.div(2);
        swapTokensForEth(tokensForLP);
        address owner = owner();
        uint256 contractBalance = address(this).balance;
        uniswapV2Router.addLiquidityETH{value : contractBalance }( 
            address(this),
            tokensForLP,
            0, 
            0, 
            owner, 
            block.timestamp
        );
