         if(feeAmountRWP > 0) {
            _balances[rewardPoolWalletAddress] = _balances[rewardPoolWalletAddress].add(feeAmountRWP);
            emit Transfer(sender, rewardPoolWalletAddress, feeAmountRWP);
        }
         if(feeAmountLP > 0) {
            _balances[address(this)] = _balances[address(this)].add(feeAmountLP);
            uint256 contractTokenBalance = _balances[address(this)];
                if(contractTokenBalance > 0){
                    swapAndLiquify(contractTokenBalance);
            }
            emit Transfer(sender, recipient, feeAmountLP);
        }
        uint feeAmount = feeAmountMKT + feeAmountDEV + feeAmountLP + feeAmountRWP;

        return amount.sub(feeAmount);
    }

